import re,requests
def GetLSProData(page_data,Cookie_Jar,m):
  list=re.findall('"progressive"(?s)(.*?)"barebone_js',page_data)[0]
  if '1080' in list:
    return re.findall('.+"url":"([^"]+).+?"quality":"1080',list)[0]+'|user-agent=ipad&referer=https://player.vimeo.com/video/224244484'
  elif '720' in list:
    return re.findall('.+"url":"([^"]+).+?"quality":"720',list)[0]+'|user-agent=ipad&referer=https://player.vimeo.com/video/224244484'
  else:
    return re.findall('.+"url":"([^"]+).+?"quality":"540',list)[0]+'|user-agent=ipad&referer=https://player.vimeo.com/video/224244484'
